from collections import Counter
from math import sqrt


def is_prime(n):
    if n == 2:
        return True
    if n % 2 == 0 or n <= 1:
        return False
    sqr = int(sqrt(n)) + 1
    for divisor in range(3, sqr, 2):
        if n % divisor == 0:
            return False
    return True


def prime_in_row(row):
    return all(is_prime(x) for x in row)


def prime_in_col(matrix, col):
    return all(is_prime(matrix[i][col]) for i in range(len(matrix)))


def prime_in_matrix(matrix):
    return prime_in_row(matrix[0]) or prime_in_col(matrix, 0)


def count_moves(matrix):
    prime = Counter()
    for i in range(len(matrix)):
        for j in range(len(matrix[i])):
            if is_prime(matrix[i][j]):
                prime[(i, j)] += 1
    return sum(prime.values())


def main():
    n, m = list(map(int, input().split()))
    matrix = []
    for _ in range(n):
        matrix.append(list(map(int, input().split())))
    print(count_moves(matrix))


