def solve(s, x, y):
    n = len(s)
    dp = [[0 for i in range(n+1)] for j in range(n+1)]
    for i in range(1, n+1):
        for j in range(1, n+1):
            if s[i-1] == '?':
                dp[i][j] = max(dp[i-1][j], dp[i][j-1])
            else:
                dp[i][j] = dp[i-1][j-1] + int(s[i-1]) * x
    return dp[n][n]


