class Solution:
    def compareVersion(self, version1, version2):
        """
        :type version1: str
        :type version2: str
        :rtype: int
        """
        v1 = [int(x) for x in version1.split('.')]
        v2 = [int(x) for x in version2.split('.')]
        while v1 and v2 and v1[-1] == v2[-1]:
            v1.pop()
            v2.pop()
        if v1:
            if max(v1) > max(v2):
                return 1
            else:
                return -1
        elif v2:
            if max(v2) > max(v1):
                return -1
            else:
                return 1
        else:
            return 0

